import React from 'react';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import PagesAddressSearch from './Address/Search/Search';


const Root = () => {
  return (
    <Router>
      <Switch>
        <Route path='/' component={PagesAddressSearch} />
      </Switch>
    </Router>
  )
}

export default Root;
